-(void)findPairs:(NSArray*)pairs withSum:(NSUInteger)sum
{
	/*!
	 *@brief Time complexity - O(n*n), Space complexity = O(1)
	 */
	for (int i = 0; i< pairs.count; i++) {
		for (int j = i+1; j<pairs.count; j++) {
			if (([[pairs objectAtIndex:i] intValue] + [[pairs objectAtIndex:j] intValue])==sum) {
				NSLog(@"\nPairs found at %d and %d, values are %@ and %@",i,j,[pairs objectAtIndex:i],[pairs objectAtIndex:j]);
				return;
			}
		}
	}
	NSLog(@"Pairs not found");
}

-(void)findPairsWithHashMap:(NSArray<NSNumber*>*)element withSum:(NSUInteger)sum
{
	/*!
	 *@brief Time complexity - 1 + N + 1 + 1 + 1 = O(n), space complexity - O(n) - has values stored only for each value of the input
	 */
	NSMutableDictionary *hashMap = [NSMutableDictionary new];  // 1
	[element enumerateObjectsUsingBlock:^(NSNumber *item, NSUInteger idx, BOOL * _Nonnull stop) { // N
		NSUInteger temp = sum - [item integerValue]; // N
		if ([[hashMap valueForKey:[NSString stringWithFormat:@"%@",item]] isEqual: @1]) { //1
			NSLog(@"\n%lu is made of %lu and %@",(unsigned long)sum,(unsigned long)temp,item); //1
//			*stop = YES;
//			return;
		}
		[hashMap setValue:@1 forKey:[NSString stringWithFormat:@"%d",(int)temp]]; //1
	}];
}

-(void)findMajorElement:(NSArray*)element
{
	__block NSUInteger highestValue = 0 ;
	__block NSUInteger counts = 0;
	NSMutableDictionary *frequency = [NSMutableDictionary new];
	[element enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		NSUInteger keyToIncrementforFrequency = [obj integerValue];
		NSUInteger countValue = [[frequency valueForKey:[NSString stringWithFormat:@"%d",(int)keyToIncrementforFrequency]] integerValue];
		++countValue;
		[frequency setValue:[NSNumber numberWithInteger:countValue] forKey:[NSString stringWithFormat:@"%d",(int)keyToIncrementforFrequency]];
	}];
	[frequency enumerateKeysAndObjectsUsingBlock:^(id  _Nonnull key, id  _Nonnull obj, BOOL * _Nonnull stop) {
		NSUInteger value = [obj integerValue];
			if ( value > highestValue) {
			highestValue = value;
				counts  = [key integerValue];
		}
	}];
	NSLog(@"\n%ld occurs %ld times",(long)counts,(long)highestValue);
}

-(void)oddOccuringNumbers:(NSArray*)element
{
	NSMutableDictionary *frequency = [NSMutableDictionary new];
	[element enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		NSUInteger item = [obj integerValue];
		NSUInteger count = [[frequency valueForKey:[NSString stringWithFormat:@"%d",(int)item]] integerValue];
		++count;
		[frequency setValue:[NSNumber numberWithInteger:count] forKey:[NSString stringWithFormat:@"%d",(int)item]];
	}];
	[frequency enumerateKeysAndObjectsUsingBlock:^(id  _Nonnull key, id  _Nonnull obj, BOOL * _Nonnull stop) {
		if ([key integerValue]%2 !=0) {
			NSLog(@"\n%@ occurs %@ times",obj,key);
		}
	}];
}

-(void)reverseArray:(NSArray*)element
{
	NSMutableArray *arrayCopy = [NSMutableArray arrayWithArray:element];
	for (int i = 0; i <= element.count/2; i++) {
		NSUInteger first = i;
		NSUInteger last = (element.count -1)-i;
		NSUInteger sum = [[element objectAtIndex:first] integerValue] + [[element objectAtIndex:last] integerValue];
		[arrayCopy setObject:[NSNumber numberWithInteger:(sum - [[arrayCopy objectAtIndex:first] integerValue])] atIndexedSubscript:first];
		[arrayCopy setObject:[NSNumber numberWithInteger:(sum - [[arrayCopy objectAtIndex:last] integerValue])] atIndexedSubscript:last];
	}
	[element enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		int item  = [obj intValue];
		printf("%d ,",item);
	}];
	printf("\n");
	[arrayCopy enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		int item  = [obj intValue];
		printf("%d ,",item);
	}];
	printf("\n");
}

-(void)rotateArray:(NSArray*)element withElementCount:(NSUInteger)elementCount
{
//	if (elementCount <= element.count) {
//		return;
//	}
//	NSLog(@"%@",element);
	__block NSMutableArray *rotatedElements = [NSMutableArray new];
	[element enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		printf("%d ,",[obj intValue]);
	}];
	printf("\n");
	[[element subarrayWithRange:NSMakeRange(elementCount, element.count-elementCount)] enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		[rotatedElements addObject:obj];
	}];
	[[element subarrayWithRange:NSMakeRange(0, elementCount)] enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		[rotatedElements addObject:obj];
	}];
	[rotatedElements enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
		printf("%d ,",[obj intValue]);
	}];
	printf("\n");
}

